import React from "react";

const topicStyle = {
  display: "flex",
  alignItems: "flex-start",
};

const fontStyle = {
  fontWeight: 200,
  fontSize: 16,
};

const iconStyle = {
  width: 30,
  height: 30,
};

function Topic() {
  return (
    <div>
      <div style={topicStyle}>
        <date style={fontStyle}>2020.6.30</date>
        <img style={iconStyle} src="/wineIcon.svg"></img>
        <h4 style={fontStyle}>新しいワインが追加されました！</h4>
      </div>
    </div>
  );
}

export default Topic;
